import React, { Component } from 'react';

export default class MenuContainer extends Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div class="menu-container">
                <div class="menu-container_icon hideDesktop" onclick="showOrHideMenu()">
                    <img id="iconMenu" src="images/menu.svg" alt="" />
                </div>
                <div class="menu-container_logo">
                    <img src="images/One-Piece-Logo 1.svg" alt="" />
                </div>
            </div>
        );
    }
}
